import React from "react";

const Header1 = () => {
    return (
        <nav id="header1">
            <div >
                <div>
                    <a href="/" className="navbar-item">
                        <img src="/src/images/logo.png" alt="logo"/>
                    </a>
                </div>
            </div>
        </nav>
    );
};

export default Header1;
